import React from 'react';
import styled from 'styled-components';

let Navbar = styled.div`
    color: white;
    display: flex;
    width: 100%;

`
let Login = styled.div`
    color: magenta;
    background-color: white;
    padding: 10px;
    border-radius: 5px;

`

let Signup = styled.div`
    color: white;
    background-color: magenta;
    padding: 10px;
    border-radius: 5px;
`

const Nav = () => {
    return (
        <Navbar>
            <Login>Login</Login>
            <Signup>Sign up</Signup>
        </Navbar>
    );
};

export default Nav;
